import React, {Component} from "react";
import { MyContext } from "../context";
import { NavSide } from "../styledComponents/StyledComps";


export default class NavProfileSide extends Component {
	showSettings (event) {
		event.preventDefault();
	}
	render(){
  return (
    <MyContext.Consumer>
      {context => (
				<NavSide>
				<h2>Bienvenido </h2>
				<ul>
					<li></li>
				</ul>

				</NavSide>
      )}
    </MyContext.Consumer>
	);
}
}
